import React, { useState, useEffect } from "react";
import Header from "./component/header";
import SearchItems from "./component/header/SearchItems";
import SearchBars from "./component/header/SearchBars";
import Container from "@material-ui/core/Container";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
      <Container fixed>
        <SearchItems />
      </Container>
    </div>
  );
}

export default App;
